■サイズ<br />
上ホルダー:幅16cm×奥行き5cm×高さ5cm<br />
下ホルダー:幅16cm×奥行き5cm×高さ8cm<br />

■材質：本体：スチール(紛体塗装)<BR>
マット：合成ゴム<BR>
■収納：4本（表示本数以上は入れないでください）<br />
