シンプルでスタイリッシュ、美しいデザインと使いやすさが大人気のtowerシリーズのアンブレラスタンドです。
「傘立ての置き場所がない！」「玄関に立てかけて置くのは見栄えが悪い」
そんな時はドアを使ってスペースを有効活用できます。

コチラの傘立ては上下ホルダーが独立しており、背面にはマグネットがついていますのでドアの大きさ、傘の大きさ、傘を取り出しやすい場所に合わせて自由にアレンジする事ができます。

デザインも清潔感のあるホワイトとクールなブラックの2色展開ですので、ドアを装飾するような感覚で美しく収納する事ができます。

マグネットが付く所にはどこにでも付けられるので冷蔵庫に取り付けてラップやアルミホイルの収納フックとして活用、なんてこともできます。

専用BOXに入っているのでプレゼントとしてもオススメです。



